import React, { useState } from 'react';
import ProfilePhotoUpload from './ProfilePhotoUpload';
import './ProfileEditModal.css';

const ProfileEditModal = ({ user, isOpen, onClose, onPhotoUpdate }) => {
  const [activeSection, setActiveSection] = useState('photo');

  if (!isOpen) return null;

  const menuItems = [
    { key: 'photo', label: 'Profil Fotoƒürafƒ±', icon: 'üì∑' },
    { key: 'password', label: '≈ûifre Deƒüi≈ütir', icon: 'üîí' },
    { key: 'email', label: 'E-posta Deƒüi≈ütir', icon: 'üìß' },
    { key: 'username', label: 'Kullanƒ±cƒ± Adƒ± Deƒüi≈ütir', icon: 'üë§' },
    { key: 'account', label: 'Hesap Ayarlarƒ±', icon: '‚öôÔ∏è' },
    { key: 'social', label: 'Sosyal Hesaplar', icon: 'üîó' },
    { key: 'contact', label: 'ƒ∞leti≈üim Bilgileri', icon: 'üìû' },
    { key: 'notifications', label: 'Bildirim Ayarlarƒ±', icon: 'üîî' },
  ];

  const renderContent = () => {
    switch (activeSection) {
      case 'photo':
        return (
          <ProfilePhotoUpload 
            user={user} 
            onPhotoUpdate={onPhotoUpdate}
          />
        );
      case 'password':
        return (
          <div className="section-content">
            <h3>≈ûifre Deƒüi≈ütir</h3>
            <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
          </div>
        );
      case 'email':
        return (
          <div className="section-content">
            <h3>E-posta Deƒüi≈ütir</h3>
            <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
          </div>
        );
      case 'username':
        return (
          <div className="section-content">
            <h3>Kullanƒ±cƒ± Adƒ± Deƒüi≈ütir</h3>
            <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
          </div>
        );
      case 'account':
        return (
          <div className="section-content">
            <h3>Hesap Ayarlarƒ±</h3>
            <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
          </div>
        );
      case 'social':
        return (
          <div className="section-content">
            <h3>Sosyal Hesaplar</h3>
            <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
          </div>
        );
      case 'contact':
        return (
          <div className="section-content">
            <h3>ƒ∞leti≈üim Bilgileri</h3>
            <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
          </div>
        );
      case 'notifications':
        return (
          <div className="section-content">
            <h3>Bildirim Ayarlarƒ±</h3>
            <div className="notification-subsections">
              <div className="subsection">
                <h4>Masa√ºst√º Bildirim Ayarlarƒ±</h4>
                <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
              </div>
              <div className="subsection">
                <h4>E-posta Bildirim Ayarlarƒ±</h4>
                <p>Bu √∂zellik yakƒ±nda eklenecek.</p>
              </div>
            </div>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="profile-edit-modal-overlay" onClick={onClose}>
      <div className="profile-edit-modal" onClick={(e) => e.stopPropagation()}>
        <div className="modal-header">
          <h2>üìù PROFƒ∞Lƒ∞Nƒ∞ D√úZENLE</h2>
          <button className="close-btn" onClick={onClose}>√ó</button>
        </div>
        
        <div className="modal-content">
          <div className="menu-sidebar">
            {menuItems.map((item) => (
              <button
                key={item.key}
                className={`menu-item ${activeSection === item.key ? 'active' : ''}`}
                onClick={() => setActiveSection(item.key)}
              >
                <span className="menu-icon">{item.icon}</span>
                {item.label}
              </button>
            ))}
          </div>
          
          <div className="content-area">
            {renderContent()}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProfileEditModal;
